import React,{Component} from 'react';
import ReactDOM from 'react-dom';
import './CommonComponent.css';
import CharacterList from './CharacterList';
import 'tachyons';



const Commoncomponent=(props)=>{
    const commonArray=[{
    	id:1,
    	name:"Pari",
    	work:"Engineer"  
      },
      {
    	id:2,
    	name:"Shiv",
    	work:"web developer"  
      },
      {
    	id:3,
    	name:"Ayush",
    	work:"Senior web developer"  
      },
      {
    	id:4,
    	name:"Gagan",
    	work:"Software developer"  
      }];
	return <div>
			<h1> Wekcome profesionals</h1>
            <CharacterList id= {commonArray[0].id} name={commonArray[0].name} work={commonArray[0].work}/>
            <CharacterList id= {commonArray[1].id} name={commonArray[1].name} work={commonArray[1].work}/>
            <CharacterList id= {commonArray[2].id} name={commonArray[2].name} work={commonArray[2].work}/>
            <CharacterList id= {commonArray[3].id} name={commonArray[3].name} work={commonArray[3].work}/>
            <button> subscribe </button></div>
}
export default Commoncomponent;
